window.addEventListener('load', () => {
  
    const popupContainer = document.querySelector('ytd-popup-container')

    const checkActivity = new MutationObserver(mutations => {

        console.log(mutations)

        if (document.querySelector('#confirm-button')) {
            console.log('confirm-button found at: ' + new Date().toString().substring(16,24));
            document.querySelector('#confirm-button').click();
            document.querySelector('video').play();
        }
    })

    checkActivity.observe(popupContainer, { childList: true, subtree: true})
 
})



